import s from './Counter.module.css'



export const Сounter = () => {


    let [value,setValue]=useState(0)

    const onclickHandlerInc = ()=> {


        setValue(value ++)
    }

    const onclickHandlerReset = ()=>{
        setValue(0)
    }

    return (
        <div className={s.fon}>
           <span>
               <div>{value}</div></span>
            <div>
                <button onClick={onclickHandlerInc}>inc</button>
                <button onClick={onclickHandlerReset}>reset</button>
            </div>

        </div>
    );
};
